import React from 'react'

const Header = () => {
    return (
        <div>
            <h1>ННН</h1>
            <h2>2000 очков</h2>
        </div>
    )
}

const SerchPanel = () => {
    return (
        <input type="text" placeholder="поиск среди игроков"/>
    )
}

const PostAddForm = () => {
    return (
       <form>
           <input type='text' placeholder="как тебя зовут">
           </input>
       </form>
    )
}


const PostListItem = () => {
    return (
        <li>
            <span>
                HHHH
            </span>
            <div>
                <button>
                    like
                </button>
                <button>
                    dislike
                </button>
            </div>
        </li>
    )
}

const PostList = () => {
    return (
       <ul>
           <PostListItem/>
           <PostListItem/>
           <PostListItem/>
       </ul>
    )
}

const PostStatusFilter = () => {
    return (
        <div>
            <button>

            </button>
            <button>

                </button>
        </div>
    )
}

export const NewReg = () => {
    return (
        <>
        <h1>Hello</h1>
        <Header/>
        <SerchPanel/>
        <PostStatusFilter/>
        <PostList/>
        </>)
}
